import React from "react";

function Registration_Landing() {
  const Nav = () => {
    <ul>
      <li>
        <Link to="registration/rental_agency"> Rental Agency Registration</Link>
      </li>
      <li>
        {" "}
        <Link to="registration/customer">Customer Registration</Link>
      </li>
    </ul>;
  };
  return (
    <div>
      <h1>Registration Landing</h1>
    </div>
  );
}

export default Registration_Landing;
